import { Link, useNavigate } from "react-router-dom";
import { logout } from "../../services/gameService";

export const Header = () => {

    const navigate = useNavigate();

    async function onLogout() {
        await logout();
        navigate('/');
    }
    return(
    <header>
        {/* <!-- Navigation --> */}
        <h1><Link to="/" className="home">GamesPlay</Link></h1>
        <nav>
            <Link to="/catalog">All games</Link>
            {/* <!-- Logged-in users --> */}
            <div id="user">
                <Link to="/createPage">Create Game</Link>
                <Link to="/logout" onClick={onLogout}>Logout</Link>
            </div>
            {/* <!-- Guest users --> */}
            <div id="guest">
                <Link to="/login">Login</Link>
                <Link to="/register">Register</Link>
            </div>
        </nav>
    </header>
    );
}
